import React from 'react';
import { BrowserRouter, Route, Switch, useHistory } from 'react-router-dom';

import Main from './pages/Main';
import Post from './pages/Post';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
       <Switch>
          <Route exact path="/">
            <Main />
          </Route>
          <Route exact path="/post/:id">
            <Post />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
